  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Mackay Island
  National Wildlife Refuge summarizes refuge activities for calendar year 1978. The
  report begins with a summary of weather and habitat conditions during the period.
  A construction and maintenance section outlines physical development and wildlfires.
  The habitat management section provides information on croplands, wetlands, wilderness
  areas, and easements for waterfowl. A wildlife section covers endangered and threatened
  species, migratory birds, and mammals. The interpretation and recreation section
  outlines recreational use, refuge visitation, hunting, and law enforcement. Items
  of interest provides information on field investigations, cooperative programs,
  and safety.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
